webpackJsonp([0x81b8806e4260],{"./node_modules/json-loader/index.js!./.cache/json/index.json":function(e,n){e.exports={data:{contentfulGatsbyPage:{id:"WvYm5twFe6kEkCQikUMok",path:"/",title:"Home",metaImage:{resize:{src:"//images.contentful.com/w9ev0ed0y4mj/1K2h1yowiQwgigQO8k2Ckc/049f041d5ae7565cb549fa93457ef094/Social_Card.jpg?w=1200&fl=progressive&q=50"}},metaDescription:{metaDescription:"Hello, We‚Äôre Gin Lane. We're creating, growing, and guiding the next generation of consumer-facing companies.  We're a digital-led creative agency located in Chinatown, New York. Nice to meet you."},components:[{__typename:"ContentfulGatsbyText",id:"c30p0owpCEw2oQYSgWw8ccw",anchor:"welcome",text:{childMarkdownRemark:{html:"<h1>Hello,<br>We‚Äôre Gin Lane.</h1>\n<h3>We're creating, growing, and guiding the next generation of consumer-facing companies.<br><br>Nice to meet you.<br><br>üëáüèΩ</h3>"}}},{__typename:"ContentfulGatsbyText",id:"C1ExF68a6yWe08YS40EQ8",anchor:"our-impact",text:{childMarkdownRemark:{html:"<h1>Our Impact</h1>\n<h3>Over the past decade, we have helped create $4 billion in startup value and have led numerous Fortune 500 businesses through today's evolving landscape. üìà</h3>"}}},{__typename:"ContentfulGatsbyText",id:"c48X3uZEU9WQQY6WIYQeOse",anchor:"our-work",text:{childMarkdownRemark:{html:"<h1>Our Work</h1>\n<h3>We launch brands to market, grow early stage start ups, and partner with category leaders - forming carefully curated relationships that are built upon a shared long-term vision.</h3>\n<h3>Explore some of our work below. üî¨</h3>"}}},{__typename:"ContentfulGatsbyText",id:"c3jmaSLfURGM0yEiQa6ySGg",anchor:"text-we-launch-brands",text:{childMarkdownRemark:{html:"<h2>I. We Launch Brands</h2>\n<h3>We bring entrepreneurs' ideas to life, from naming, branding, and positioning through design, development, and launch.</h3>\n<h4>VIEW SELECT PROJECTS BELOW</h4>"}}},{__typename:"ContentfulGatsby5050",id:"c1NC11B3H2IqWuYcEYmkwE8",alignment:!0,anchor:"50-50-hims",copy:{id:"c1NC11B3H2IqWuYcEYmkwE8copyTextNode",childMarkdownRemark:{id:"c1NC11B3H2IqWuYcEYmkwE8copyTextNode >>> MarkdownRemark",html:'<h4>LAUNCHED TO MARKET</h4>\n<h2>Hims</h2>\n<p>Working with an all-star team, we crafted a web presence and art direction to bring Hims to market; a men‚Äôs wellness brand aimed at normalizing treatment for hair-loss, erectile dysfunction and adult acne. Our goal was to provide detailed information and solutions in an approachable, relatable and personal fashion. Hims features natural skin-tone colors, a diverse, youthful cast, conversational copy (and emojis), and a warm, playful site design.</p>\n<p><a href="https://forhims.com" target="_blank">Visit forhims.com</a></p>'}},image:{description:"",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/lgIK0LdYNEssQUcoC6I0e/e7d13c226f0da93126f9478299447f11/Hims.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c3YuFTgppA4GAKaMCgcSCuS",alignment:!1,anchor:"raden",copy:{id:"c3YuFTgppA4GAKaMCgcSCuScopyTextNode",childMarkdownRemark:{id:"c3YuFTgppA4GAKaMCgcSCuScopyTextNode >>> MarkdownRemark",html:'<h4>LAUNCHED TO MARKET</h4>\n<h2>Raden</h2>\n<p>We oversaw each step of Raden‚Äôs go-to-market digital customer experience, shepherding the brand from a physical product to a rich, multi-faceted digital experience including an e-commerce website and travel companion iOS app.</p>\n<p><a href="https://raden.com" target="_blank">Visit Raden.com</a> &#x26; <a href="https://itunes.apple.com/us/app/raden-smart-travel-case/id1089228710?mt=8" target="_blank">Download the app</a></p>'}},image:{description:"Raden luggage",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/5xlb6x2PG88222qQQAwkG0/0b24604cce31b7b3c37edf4912ed2847/Raden.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c5IJ07A5lQIsqAco2KwmGwQ",alignment:!0,anchor:"tomorrow",copy:{id:"c5IJ07A5lQIsqAco2KwmGwQcopyTextNode",childMarkdownRemark:{id:"c5IJ07A5lQIsqAco2KwmGwQcopyTextNode >>> MarkdownRemark",html:'<h4>LAUNCHED TO MARKET</h4>\n<h2>Tomorrow</h2>\n<p>By combining our expertise in launching experience-first brands with the manufacturing capabilities of our partner, we created a sleep company positioned around health and wellness. We designed a brand and an ecosystem of products, physical and digital, centered around the feeling of waking up energized and ready to take on tomorrow.</p>\n<p><a href="https://tomorrowsleep.com" target="_blank">Visit Tomorrowsleep.com</a></p>'}},image:{description:"Tomorrow Sleep",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/2ayEnemrAkg8IOOiw6AGuY/845aa8b8c552e4b7deaead9c3720613e/Tomorrow-min.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c58RmJWaDrquAwUiOyoii8G",alignment:!1,anchor:"sunday-goods",copy:{id:"c58RmJWaDrquAwUiOyoii8GcopyTextNode",childMarkdownRemark:{id:"c58RmJWaDrquAwUiOyoii8GcopyTextNode >>> MarkdownRemark",html:'<h4>LAUNCHED TO MARKET</h4>\n<h2>Sunday Goods</h2>\n<p>Based in Arizona, Sunday Goods is the largest vertically integrated cannabis farm in the U.S. Our team set out to create a name and brand that could cut through the noise of a young, but crowded cannabis market. Following launch, we designed and built a custom technology solution for mobile cannabis delivery.</p>\n<p><a href="https://shop.sundaygoods.com/" target="_blank">Shop from Sunday Goods</a></p>'}},image:{description:"Sunday Goods cannabis delivery",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/nkXpLSLELQW0U0Y0AqCqM/f172e33d46b072c0c9a947a3b55abd42/SundayGoods-min.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c4YVkMUgbC0YOEE2SMEukIk",alignment:!0,anchor:"harrys",copy:{id:"c4YVkMUgbC0YOEE2SMEukIkcopyTextNode",childMarkdownRemark:{id:"c4YVkMUgbC0YOEE2SMEukIkcopyTextNode >>> MarkdownRemark",html:'<h4>LAUNCHED TO MARKET</h4>\n<h2>Harry\'s</h2>\n<p>Jeff Raider and Andy Katz-Mayfield came to us with a simple but powerful idea: to create a digital-first razor company that offers a quality shave at a respectable price. Through close collaboration, Gin Lane launched Harry\'s to market by designing and developing a brand story and digital storefront that we continue to collaborate on today.</p>\n<p><a href="https://harrys.com" target="_blank">Visit Harrys.com</a></p>'}},image:{description:"Harry's shaving products",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/1oFfWBPW9yuAayAwEukesq/fa90f37dbf44c07eeea4ab0110298c72/Harrys-min.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"y1BNovAo5qAqWSeoAg0I6",alignment:!1,anchor:"jeff-raider-quote",copy:{id:"y1BNovAo5qAqWSeoAg0I6copyTextNode",childMarkdownRemark:{id:"y1BNovAo5qAqWSeoAg0I6copyTextNode >>> MarkdownRemark",html:"<blockquote>\n<p>The team at Gin Lane have been amazing partners to us since day one of Harry's. We worked closely together to bring our brand to life in the digital world, and they have since helped us to reimagine our digital experience over time.</p>\n</blockquote>\n<p>- <strong>Jeff Raider</strong>, co-founder, Harry's</p>"}},image:{description:"Harry's co-founder quote",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/3PyzWZwE2QUa26uWIAIu0m/7ab43715cb63896b864fc55e6c89025a/harrys-quote.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsbyText",id:"c3x1yKUqL28yeYaaMcKsWks",anchor:"we-grow-startups",text:{childMarkdownRemark:{html:"<h2>II. We Grow Businesses</h2>\n<h3>We transform emerging companies into industry leaders by refining the brand's personality and elevating the digital experience.</h3>\n<h4>VIEW SELECT PROJECTS BELOW</h4>"}}},{__typename:"ContentfulGatsby5050",id:"c5n3LbCJylqEAwMcoU6Askq",alignment:!1,anchor:"smile-direct-club",copy:{id:"c5n3LbCJylqEAwMcoU6AskqcopyTextNode",childMarkdownRemark:{id:"c5n3LbCJylqEAwMcoU6AskqcopyTextNode >>> MarkdownRemark",html:'<h4>EARLY STAGE GROWTH</h4>\n<h2>Smile Direct Club</h2>\n<p>Smile Direct Club offers high quality invisible aligners direct to the consumer at an affordable price. In reshaping the branding, content, and digital experience, we crafted an empathetic and conversational personality, designed to foster trust, and importantly, make people smile.</p>\n<p><a href="http://smiledirectclub.com" target="_blank">Visit Smiledirectclub.com</a></p>'}},image:{description:"Smile Direct Club",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/6exrEPfbtCki86w4mQ66My/f800b32299314da9f72cd10c46ec4364/SmileDirect.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c10s4q5JTscMm4OwYUASaoW",alignment:!0,anchor:"dia",copy:{id:"c10s4q5JTscMm4OwYUASaoWcopyTextNode",childMarkdownRemark:{id:"c10s4q5JTscMm4OwYUASaoWcopyTextNode >>> MarkdownRemark",html:'<h4>EARLY STAGE GROWTH</h4>\n<h2>Dia &#x26; Co.</h2>\n<p>Dia &#x26; Co. is a subscription styling service for plus sized women. Within our work, empowering the customer was the focus, allowing Dia&#x26;Co. to build ongoing relationships with women exploring their unique personal style through a refreshed branding, packaging, positioning and online experience.</p>\n<p><a href="http://dia.com" target="_blank">Visit Dia.co</a></p>'}},image:{description:"Dia&Co subscription styling service",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/fpGDf4iUq4G68eYUASWqA/f537ff77edf9e41bd486659984e9ad42/Dia.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c2RfZ2ds6eIMoMAwYuC8wgw",alignment:!1,anchor:"sweetgreen",copy:{id:"c2RfZ2ds6eIMoMAwYuC8wgwcopyTextNode",childMarkdownRemark:{id:"c2RfZ2ds6eIMoMAwYuC8wgwcopyTextNode >>> MarkdownRemark",html:'<h4>EARLY STAGE GROWTH</h4>\n<h2>Sweetgreen</h2>\n<p>Our work with Sweetgreen established an entirely new way of integrating digital tools into fast-casual restaurants. We architected, designed, and built their online ordering and native iOS app experiences and continue to iterate with them today as they scale. </p>\n<p><a href="http://order.sweetgreen.com" target="_blank">Order Sweetgreen</a> &#x26; <a href="https://itunes.apple.com/us/app/sweetgreen/id594329490?mt=8" target="_blank">Download the Sweetgreen app</a></p>'}},image:{description:"Sweetgreen salads",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/6k5PULdxJukiOswiYsMgUI/595a1d20b5a5edc458f9db1bea3248e4/Sweetgreen.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c1oJDSN03W0ikomicoY8QSC",alignment:!0,anchor:"sweetgreen-quote",copy:{id:"c1oJDSN03W0ikomicoY8QSCcopyTextNode",childMarkdownRemark:{id:"c1oJDSN03W0ikomicoY8QSCcopyTextNode >>> MarkdownRemark",html:"<blockquote>\n<p>Gin Lane has been a trusted partner for almost 5 years, helping us tell our brand story by creating experiences that merge the physical and digital world. They're forward thinking, strategic, have an incredible eye, and continually push us to be better.</p>\n</blockquote>\n<p>- <strong>Jonathan Neman</strong>, co-founder, Sweetgreen</p>"}},image:{description:"Sweetgreen co-founder quote",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=800&q=50",
srcSet:"//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/38DQS6cSxyGiWEEm6US4kq/f7786d26e4939724fa9de7abba4cb382/sweetgreen-quote.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsbyText",id:"v9oHWNDoPIu0y0268U8eO",anchor:"we-partner",text:{childMarkdownRemark:{html:"<h2>III. We Partner with Leaders</h2>\n<h3>We provide an entrepreneurial skillset for established companies to help evolve their place in today's consumer-first world. We build ground-up corporate ventures and work side-by-side with internal innovation teams.</h3>\n<h4>VIEW SELECT PROJECTS BELOW</h4>"}}},{__typename:"ContentfulGatsby5050",id:"c4aMqfex8QEQoiScyM42EKY",alignment:!1,anchor:"365-by-wholefoods",copy:{id:"c4aMqfex8QEQoiScyM42EKYcopyTextNode",childMarkdownRemark:{id:"c4aMqfex8QEQoiScyM42EKYcopyTextNode >>> MarkdownRemark",html:'<h4>INDUSTRY LEADER PARTNERSHIP</h4>\n<h2>365 by WFM</h2>\n<p>Gin Lane partnered with Whole Foods to reimagine the grocery store, focusing on digital-led experience and item-specific personalized nutritional information for their first offshoot retail brand: the affordable, smaller store footprint, 365. We led strategy, design &#x26; development for the online platform, and in-store integration.</p>\n<p><a href="https://www.365bywfm.com" target="_blank">Shop 365byWFM.com</a></p>'}},image:{description:"365 by Whole Foods",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/5xj1jwQrgkMAaAYc0mwsii/aa0d8751a5081f1b8a928aef3bea040e/365-min.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c3cXdRELjfWAM2oy0igWc8G",alignment:!0,anchor:"j-crew",copy:{id:"c3cXdRELjfWAM2oy0igWc8GcopyTextNode",childMarkdownRemark:{id:"c3cXdRELjfWAM2oy0igWc8GcopyTextNode >>> MarkdownRemark",html:'<h4>INDUSTRY LEADER PARTNERSHIP</h4>\n<h2>J. Crew</h2>\n<p>Gin Lane helped to bring interactivity and storytelling to J.Crew\'s in-store personal shopping program, Very Personal Stylist. The output came to life in the form of seasonal interactive stories displayed in-store installations from shops in New York to California.</p>\n<p><a href="https://vimeo.com/58379873" target="_blank">See the J.Crew app in action</a></p>'}},image:{description:"J.Crew fashion retailer",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/3Atn0rMIiAUIY8q6EGgKAA/e81f2d510058a836fdfd1083bdb129e7/jcrew.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c49QCikkPVKaQgIiYiuoaEg",alignment:!1,anchor:"ge",copy:{id:"c49QCikkPVKaQgIiYiuoaEgcopyTextNode",childMarkdownRemark:{id:"c49QCikkPVKaQgIiYiuoaEgcopyTextNode >>> MarkdownRemark",html:'<h4>INDUSTRY LEADER PARTNERSHIP</h4>\n<h2>GE</h2>\n<p>GE, Qwake and Gin Lane collaborated closely to tell the story of GE‚Äôs effort to better understand our Earth through data. We concepted, designed, developed, and produced an award-winning website, \'A Digital Volcano,\' to provide users with an interactive journey into the heart of an active lava lake in Masaya, Nicaragua. </p>\n<p><a href="http://ge.com/digitalvolcano" target="_blank">Visit A Digital Volcano</a></p>'}},image:{description:"GE - A Digital Volcano",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/OxmJDo8kGy2WW6620OcIg/1e4257e1618860879186b073443b5cd4/GE.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsby5050",id:"c6Dz3gl61kAQyqO6oso0GyI",alignment:!0,anchor:"make-a-wish-quote",copy:{id:"c6Dz3gl61kAQyqO6oso0GyIcopyTextNode",childMarkdownRemark:{id:"c6Dz3gl61kAQyqO6oso0GyIcopyTextNode >>> MarkdownRemark",html:"<blockquote>\n<p>Radical ideas need radical builders and there is no better team on the internet suited for making magic than the Gin Lane crew.</p>\n</blockquote>\n<p>- <strong>Sam Olstein</strong>, Global Director of Innovation, GE</p>"}},image:{description:"GE Sam Olstein quote",responsiveSizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=800&q=50",srcSet:"//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=200&h=200&q=50 200w,\n//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=400&h=400&q=50 400w,\n//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=800&h=800&q=50 800w,\n//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=1200&h=1200&q=50 1200w,\n//images.contentful.com/w9ev0ed0y4mj/1CZv368w0kEwMKGO8cykSY/80f31d3979ce47ebea6372fe3d04497e/ge-quote.png?w=1400&h=1400&q=50 1400w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulGatsbyText",id:"c3zDT6HsSMMKWQosS0SIccM",anchor:"capabilities",text:{childMarkdownRemark:{html:"<h4>CAPABILITIES</h4>\n<h2>Four disciplines,<br>one fluid process.</h2>\n<h3>We strive for creative excellence through research, empathy and detailed execution.</h3>\n<h4>EXPLORE OUR FOUR DISCIPLINES BELOW</h4>"}}},{__typename:"ContentfulGatsbyCapabilityList",id:"c6pMCgSDYAMSu0KKKYIqOIA",anchor:"capabilities-list",eyebrow:"CAPABILITIES ‚úçüèæ",capabilities:[{id:"c4tfiIL90LmUQSOiM28U82y",title:"Brand Development",text:{childMarkdownRemark:{html:"<h5>We create and position brands, from strategy to identity, that foster deep relationships that enhance our consumers‚Äô lives. üôãüèΩ</h5>\n<ul>\n<li>Strategy</li>\n<li>Naming</li>\n<li>Voice</li>\n<li>Visual Identity Design</li>\n<li>Packaging Design</li>\n<li>Art Direction</li>\n</ul>"}}},{id:"c5eSApFyehGYygwuAQ6oQGk",title:"Interactive Content",text:{childMarkdownRemark:{html:"<h5>Placing content at the center of an experience is the key to creating engaging and interactive narratives. We work closely with our partners to ensure a seamless process and execution of creative vision. üìΩ</h5>\n<ul>\n<li>Creative Direction</li>\n<li>Production Oversight</li>\n<li>Motion Graphics &#x26; Animation</li>\n<li>Copywriting </li>\n<li>Illustration</li>\n</ul>"}}},{id:"NHm9ZnGR8W86iOgam2cwe",title:"Experience Design",text:{childMarkdownRemark:{html:"<h5>By putting the user first, we create seamless and intuitive product experiences that empower and delight our users, meeting them where they are online and offline. üì≤</h5>\n<ul>\n<li>Product Strategy</li>\n<li>User Experience Design</li>\n<li>Product Design &#x26; Motion</li>\n</ul>"}}},{id:"c2UdCmRoiScOIUsSuSSkM4G",title:"Technology",text:{childMarkdownRemark:{html:"<h5>Adaptive digital technologies are the backbone for today's modern brands. We work with our partners to develop stress-tested, scalable products. üî©</h5>\n<ul>\n<li>Multi-platform Apps (Web &#x26; Mobile) </li>\n<li>E-Commerce</li>\n<li>Digital In-Store </li>\n<li>Content Management Systems</li>\n<li>Technology Landscape</li>\n<li>Audit &#x26; Planning</li>\n</ul>"}}}]},{__typename:"ContentfulGatsbyText",id:"EjUCSmWBtmwcco08I4Q2S",anchor:"social-awareness",text:{childMarkdownRemark:{html:'<h4>COMMUNITY</h4>\n<h2>We Care.</h2>\n<h3>To give back to our community, each year we partner with organizations like Make A Wish, LES Girls Club, TBNC, Rockaway Relief, Art Start NYC, &#x26; Summit Academy to provide our services, mentorship, and raise funding.</h3>\n<h3>This year, our team helped design and develop an <a href="https://github.com/giveone/giveone" target="_blank">open-source</a> micro-donation platform for our partners to make giving easy and accessible. It‚Äôs called <a href="https://give-one.org" target="_blank">Give One</a>.</h3>'}}}]}},pathContext:{id:"WvYm5twFe6kEkCQikUMok"}}}});
